module.exports = a = async ({params}) => {
    console.log('params: ', params)

   try {
    if (!params.input) {
        return {
            error: {
                code: 500,
                message: "Missing input"
            }
        };
    }

    let parsedInput;
    try {
        parsedInput = typeof params.input === 'string' ? JSON.parse(params.input) : params.input;
    } catch (e) {
        return {
            error: {
                code: 500,
                message: "Failed to parse input JSON"
            }
        };
    }

    if (!parsedInput.rawResponse) {
        return {
            error: {
                code: 500,
                message: "Missing rawResponse in input"
            }
        };
    }

    let rawResponse;
    try {
        rawResponse = typeof parsedInput.rawResponse === 'string' ? JSON.parse(parsedInput.rawResponse) : parsedInput.rawResponse;
    } catch (e) {
        return {
            error: {
                code: 500,
                message: "Failed to parse rawResponse JSON"
            }
        };
    }

    if (!rawResponse.body) {
        return {
            error: {
                code: 500,
                message: "Missing body in rawResponse"
            }
        };
    }

    let body;
    try {
        body = typeof rawResponse.body === 'string' ? JSON.parse(rawResponse.body) : rawResponse.body;
    } catch (e) {
        return {
            error: {
                code: 500,
                message: "Failed to parse body JSON"
            }
        };
    }

    if (body.success) {
        return {
            success: body.success,
            code: rawResponse.statusCode,
            message: body.message
        };
    } else {
        return {
            error: {
                code: rawResponse.statusCode || 500,
                message: body.message || "Unknown error occurred"
            }
        };
    }

} catch (err) {
    console.error('Error parsing input: ', err);
    return {
        error: {
            code: 500,
            message: "Unknown error occurred"
        }
    };
}
}

